import React, {useState } from "react"
import { StyleSheet, View } from "react-native"
import { connect } from "react-redux"

import colors from "../../config/colors"
import Screen from "../../componets/Screen"
import ImageInput from "../../componets/ImageInput"
import ProfileSnip from "../../componets/ProfileSnip"
import ListItem from "../../componets/ListItem"
import Icon from "../../componets/Icon"
import AppText from "../../componets/AppText"
import ListItemSeparator from "../../componets/ListItemSeparator"


function UserDetails({ navigation, user }) {
  const [username, setUsername] = useState('')
  const [password, setPassword] = useState('')


return (
  <Screen>
    <View style={styles.container}>
        <ProfileSnip
          title={user.username}
          image={user.picture}
        />
      </View>
    <View style={styles.container}>
      <AppText>Account Details</AppText>
      <ListItem
        title={'Username'}
        subTitle={user.username}
        IconComponent={
          <Icon
            name={'account'}
            backgroundColor={colors.primary}
            />
          }
            onPress={() => {navigation.navigate('Home')}}
          />
      <ListItemSeparator/>
      <ListItem
        title={'Email'}
        subTitle={user.email}
        IconComponent={
          <Icon
            name={'email'}
            backgroundColor={colors.primary}
            />
          }
            onPress={() => {navigation.navigate('Home')}}
          />
      <ListItemSeparator/>
      <ListItem
        title={'Password'}
        subTitle={'***********'}
        IconComponent={
          <Icon
            name={'key'}
            backgroundColor={colors.primary}
            />
          }
            onPress={() => {navigation.navigate('Home')}}
          />
    </View>

    {/* <ImageInput 
    imageUris={picture}
    onChangeImage={() => onRemoveImage(uri)}
    /> */}
  </Screen>
)
}

function mapStateToProps (globalState) {
  return {
    user:globalState.user
  }
}

export default connect(mapStateToProps)(UserDetails)

const styles = StyleSheet.create({
  screen: {
    backgroundColor: colors.white,
  },
  container: {
    marginVertical: 20,
  },
  logo: {
    width: 66,
    height: 58,
  },
})
